import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';
import { Line } from 'react-chartjs-2';

const App = () => {
  const [data1, setData1] = useState([]);
  const [data2, setData2] = useState([]);
  const [data3, setData3] = useState([]);
  const [data4, setData4] = useState([]);
  const [data5, setData5] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response1 = await axios.get('URL1');
      setData1(response1.data);

      const response2 = await axios.get('URL2');
      setData2(response2.data);

      const response3 = await axios.get('URL3');
      setData3(response3.data);

      const response4 = await axios.get('URL4');
      setData4(response4.data);

      const response5 = await axios.get('URL5');
      setData5(response5.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  const chartData = {
    labels: [...Array(data1.length).keys()],
    datasets: [
      {
        label: 'Data 1',
        data: data1,
        fill: false,
        borderColor: 'rgba(75,192,192,1)',
        tension: 0.1,
      },
      {
        label: 'Data 2',
        data: data2,
        fill: false,
        borderColor: 'rgba(255,99,132,1)',
        tension: 0.1,
      },
      {
        label: 'Data 3',
        data: data3,
        fill: false,
        borderColor: 'rgba(54, 162, 235, 1)',
        tension: 0.1,
      },
      {
        label: 'Data 4',
        data: data4,
        fill: false,
        borderColor: 'rgba(255, 206, 86, 1)',
        tension: 0.1,
      },
      {
        label: 'Data 5',
        data: data5,
        fill: false,
        borderColor: 'rgba(153, 102, 255, 1)',
        tension: 0.1,
      },
    ],
  };

  return (
    <div>
      <div className="chart-container">
        <Line data={chartData} />
      </div>
      <div className="data-container">
        <div className="data-item">
          <h2>Data 1</h2>
          <p>{JSON.stringify(data1)}</p>
        </div>
        <div className="data-item">
          <h2>Data 2</h2>
          <p>{JSON.stringify(data2)}</p>
        </div>
        <div className="data-item">
          <h2>Data 3</h2>
          <p>{JSON.stringify(data3)}</p>
        </div>
        <div className="data-item">
          <h2>Data 4</h2>
          <p>{JSON.stringify(data4)}</p>
        </div>
        <div className="data-item">
          <h2>Data 5</h2>
          <p>{JSON.stringify(data5)}</p>
        </div>
      </div>
    </div>
  );
};

export default App;
